import React, { Component } from 'react';

import {
  Column,
  Columns,
  Level,
  LevelLeft,
  LevelRight
} from 'bloomer';

import {
  Title,
  Field,
  DateTimePicker,
  Select
} from 'shipnow-mercurio';

import { ReactComponent as SvgDraw } from '../../assets/undraw_booking_33fn.svg';

class AppointmentCreation extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <React.Fragment>
        <Level>
          <LevelLeft>
            <Title>Nuevo turno</Title>
          </LevelLeft>
        </Level>
        <hr/>
        <Columns>
          <Column isSize={ 4 }>
            <Field label="¿Que día querés venir?" labelNote="Seleccioná ua fecha">
              <DateTimePicker />
            </Field>
          </Column>
          <Column isSize={ 8 } className="has-text-right">
            <SvgDraw style={{ height: '500px', width: '500px' }}/>
          </Column>
        </Columns>
      </React.Fragment> )
  }
}

export default AppointmentCreation;
